async function copyCode(e,t){let o=e.querySelector("code"),n=o.innerText;await navigator.clipboard.writeText(n),t.innerText="Copied",setTimeout(()=>{t.innerHTML=copyButtonLabel},700)}const copyButtonLabel='<img src="../../assets/copy.png">';let blocks=document.querySelectorAll("pre");blocks.forEach(e=>{if(navigator.clipboard){let t=document.createElement("button");t.innerHTML=copyButtonLabel,e.appendChild(t),t.addEventListener("click",async()=>{await copyCode(e,t)})}});